package flowcontrols;

public class pattern7 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int count=1;

		for (int i=1;i<11;i++)
		{
			for(int j=1;j<11;j++)
				
			{
				System.out.print(count++ +"\t");
				
			}
			System.out.println();
		}
	}
}
